import React from 'react';
import products from '../data/products';
import ProductCard from './ProductCard';

export default function ProductList(){
  return (
    <div>
      <h2>Products</h2>
      <div className="products">
        {products.map(p=> <ProductCard key={p.id} product={p} />)}
      </div>
    </div>
  );
}
